window.bookSummaryJSON = "<p>A ruined life. A broken heart.&nbsp;&nbsp;</p> <p>He thought it was the end, and his gun sat ready to make sure. But an oddball offer from his last friend comes at the literal last second. Curiosity gets the best of him, and he finds himself sucked into <i>iNcarn8</i>, a game claiming to be a whole new life.&nbsp;</p> <p>Now, as Montana, the larger-than-life tank warrior, he has one more last time to get his life right.</p>"; 
